import React from "react";
import NavbarItem from "./navbarItem";
import AuthService from "../app/services/authService";
import { AuthConsumer } from "../main/authProvider";

const logout = () => {
  AuthService.removeAuthenticatedUser();
};

// const isUserAuthenticated = () => {
//   console.log(AuthService.isUserAuthenticated());
//   return AuthService.isUserAuthenticated();
// };

function Navbar(props) {
  return (
    <div className="navbar navbar-expand-lg fixed-top navbar-dark bg-primary">
      <div className="container">
        <a href="https://bootswatch.com/" className="navbar-brand">
          Minhas Finan√ßas
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarResponsive"
          aria-controls="navbarResponsive"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarResponsive">
          <ul className="navbar-nav">
            <NavbarItem
              render={props.isUserAuthenticated}
              href="#/home"
              label="Home"
            />
            <NavbarItem
              render={props.isUserAuthenticated}
              href="#/cadastro-usuario"
              label="Add User"
            />
            <NavbarItem
              render={props.isUserAuthenticated}
              href="#/entries"
              label="Entries"
            />
            <NavbarItem
              render={props.isUserAuthenticated}
              onClick={logout}
              href="#/login"
              label="Logout"
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default () => (
  <AuthConsumer>
    {(context) => (
      <Navbar isUserAuthenticated={context.isUserAuthenticated}></Navbar>
    )}
  </AuthConsumer>
);
